const M=1000000007n,randomGenerator=LCG(23n,0n,M,BigInt(Date.now())%M);function naive(n){if(n<3)return!0;if(n%2==0)return!1;for(let e=3;e*e<=n;e+=2)if(n%e==0)return!1;return!0}function millerRabin(n){let e=randomGenerator.random()*(n-2n)/M+2n;return 1n===GCD(e,n)&&(1n===modPower(e,n-1n,n)&&witness(e,n))}function witness(n,e){let r,[t,o]=decompose(e-1n),s=modPower(n,o,e);if(1n===s)return!0;for(;1n<t;){if(1n===(r=s*s%e))return s===e-1;s=r}return!1}function decompose(n){let e=0n;for(;1n&n;)++e,n>>=1n;return[e,n]}function GCD(n,e){for(;0n!==e;){const r=e;e=n%e,n=r}return n}function modPower(n,e,r){if(1n===e)return n;const t=modPower(n,e/2n,r);return 1n&e?t*t*n%r:t*t%r}function LCG(n,e,r,t){return{random:function(){return t=(n*t+e)%r}}}self.onmessage=n=>{let e,r=n.data;r<1n?self.postMessage("Bạn phải nhập số dương."):(e=r<BigInt(1e6)?naive(Number(r)):millerRabin(r))?self.postMessage("Nguyên tố."):self.postMessage("Hợp số.")};